import React from 'react';

const Card = () => {
  return(
    <div className="">
      <img alt="Foto Robot" src="https://robohash.org/test?200x200" />
      <div>
        <h2>Jane Doe</h2>
        <p>janedoe@gmail.com</p>
      </div>
    </div>
  );
}


export default Card;
